import { takeLatest, put, all } from "redux-saga/effects";

import userActiontypes from "./user.types";
import UserActionTypes from "./user.types";

import { auth, googleProvider } from "../../utils/firebase/firebase.utils";
import { createUserProfileDocument } from "../../utils/firebase/firestore.utils";

export function* signInWithGoogle() {
  try {
    console.log(
      "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaahee"
    );

    const { user } = yield auth.signInWithPopup(googleProvider);
  } catch (error) {}
}

export function* onGoogleSignInStart() {
  console.log("called");

  yield takeLatest(UserActionTypes.GOOGLE_SIGNIN_START, signInWithGoogle);
}

export function* userSagas() {
  yield all([call(onGoogleSignInStart)]);
}
